import React from "react";

const Noteitems = (props) => {
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">{props.notes.title}</h5>
        <p className="card-text">
          {props.notes.description}
        </p>
      </div>
    </div>
  );
};

export default Noteitems;
